import React from "react";

class List extends React.Component{
    render(){
        return(
            <div>
                <h1>Chores</h1>
                    {this.props.items.map((item, index) =>
                      <input type='checkbox'> <li key={index}>{item}</li></input>)}
            </div>
        )
    }
}

export default List
